description:
Автомобиль прошёл полную техническую проверку и готов к эксплуатации.
Проверен на отсутствие кредита и залога, юридически чист, есть возможность испытать его до покупки. 
Выберите свой автомобиль с пробегом в Автобан Эксперт и обменяй на свой с выгодой до 25 000 рублей.
При покупке в кредит выгода до 50 000 рублей.
Варианты приобретения: наличный/безналичный расчет, в кредит, обмен Вашего автомобиля с пробегом с доплатой и без.
Комплектация автомобиля:
Подушки безопасности (водителя, пассажира, шторки боковые, боковые передние, боковые задние); 
Регулировка сиденья водителя;
Регулировка сиденья пассажира; 
Обогрев сидений; 
Обивка салона (ткань); 
Регулировка руля (по высоте, по углу наклона); 
Усилитель руля (электрический); 
Управление климатом (двузонный климат контроль); 
Электроприводы (передних стекол, задних стекол, зеркал); 
Подлокотник передний; 
Магнитола; 
Аудиоподготовка; 
Охранная система (центральный замок с ДУ, иммобилайзер); 
Омыватели фар; 
Датчик света; 
Датчик дождя; 
Бортовой компьютер; 
Фары (Галогеновые, Противотуманные); 
Катализатор; 
Корректор фар; 
Антиблокировочная система; 
Антипробуксовочная система.
Наши специалисты готовы предложить вам лучшие условия! 
